?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Данная компания является одной из самых старейших часовых компании Германии. Она была основана Робертом Мулом в 1869 году. Уже целых 5 поколений семьи основателя компании занимаются производством уникальных прибором для измерения времени. Изначально компания занималась выпуском специальных измерительных приборов, которые, в свою очередь, внесли огромнейший вклад в развитие часовой промышленности Германии. Интересно, что в 1896 году, компании удалось получить золотую медаль на выставке в Дрездене (что удавалось немногим немецким часовым компаниям). С 1920 года, компания решает производить механизмы и приборы для техников и ученых. Но, после Второй Мировой войны компания развалилась, и, в течение долгого времени, не могла восстановиться. Однако, к концу 20-го века, в 1994 году, компания восстанавливается и запускает производство навигационных прибором и морских хронометров, которые отличались высоким качеством и надежностью. А уже в 1996 году, компания выпускает механические часы под своим названием. В коллекциях немецкой компании представлено широкое множество экземпляров часов, как женских, так и мужских. Отличительная особенность этих часов элегантность корпуса и аристократическое исполнение. Кроме того, компания предлагает и «морские» часы, которые производятся для моряков, спасателей и других представителей морских профессий. Эти немецкие многофункциональные часы поразят своим качеством и надежностью любого ценителя часового искусства/</span></span></p>
 
